/**
 * Get SVG content by name
 */
export function getSvgContent(name: string): string {
  const content = embeddedSvgs[name];
  if (!content) {
    throw new Error(`Unknown SVG: ${name}. Available: ${Object.keys(embeddedSvgs).join(', ')}`);
  }
  return content;
}
